drop table if exists cars;
create table cars 
(
	id INT NOT NULL PRIMARY KEY,
	make VARCHAR(50),
	model VARCHAR(50),
	year VARCHAR(50),
	VIN VARCHAR(50)
);


SELECT * from cars WHERE make LIKE '____' OR make='Volvo' AND
year > 1988;

SELECT COUNT(*) FROM cars WHERE make='Ford';
SELECT * FROM cars GROUP BY make;
SELECT COUNT(*), make FROM cars GROUP BY make;
SELECT COUNT(*), make FROM cars GROUP BY make ORDER BY make;
SELECT COUNT(*), make FROM cars GROUP BY make ORDER BY make ASC;
SELECT COUNT(*), make FROM cars GROUP BY make ORDER BY COUNT(*) DESC;
SELECT COUNT(*) AS liczba, make FROM cars GROUP BY make ORDER BY make;
SELECT COUNT(*) liczba, make FROM cars GROUP BY make ORDER BY liczba DESC;
SELECT COUNT(*) liczba, make, model FROM cars GROUP BY make, model ORDER BY liczba DESC;
SELECT AVG(year), make FROM cars GROUP BY make ORDER BY AVG(year);
SELECT SUM(year) liczba, make FROM cars GROUP BY make ORDER BY SUM(year);
SELECT YEAR(CURDATE())-round(AVG(year)) as wiek, make FROM cars GROUP BY make ORDER BY wiek;